        taxes and fees\",\"showOpenInNewIcon\":true}},{\"merchandiseItemRenderer\":{\"title\":\"Rick
        Astley Free Vinyl Record LP Album\",\"description\":\"Free is the third studio
        album by English singer Rick Astley, released on 12 March 1991 by RCA Records.
        It was his first album not to be produced by the noted production team of
        Stock Aitken Waterman. It gave Astley another hit single in the ballad \\\"Cry
        for Help\\\", which became a Top 10 in both the UK and US. Further singles
