        more\"},\"showLessText\":{\"simpleText\":\"Show less\"},\"attributedDescriptionBodyText\":{\"content\":\"The
        official video for \u201CNever Gonna Give You Up\u201D by Rick Astley. \\n\\nThe
        new album 'Are We There Yet?' is out now: Download here: https://RickAstley.lnk.to/AreWeThereY...\\n\\n\u201CNever
        Gonna Give You Up\u201D was a global smash on its release in July 1987, topping
        the charts in 25 countries including Rick\u2019s native UK and the US Billboard
        Hot 100.  It also won the Brit Award for Best single in 1988. Stock Aitken
        and Waterman wrote and produced the track which was the lead-off single and
        lead track from Rick\u2019s debut LP \u201CWhenever You Need Somebody\u201D.
        \ The album was itself a UK number one and would go on to sell over 15 million
        copies worldwide.\\n\\nThe legendary video was directed by Simon West \u2013
        who later went on to make Hollywood blockbusters such as Con Air, Lara Croft
        \u2013 Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube
        views milestone on 28 July 2021.\\n\\nSubscribe to the official Rick Astley
        YouTube channel: https://RickAstley.lnk.to/YTSubID\\n\\nFollow Rick Astley:\\nFacebook:
        https://RickAstley.lnk.to/FBFollowID \\nTwitter: https://RickAstley.lnk.to/TwitterID
        \\nInstagram: https://RickAstley.lnk.to/InstagramID \\nWebsite: https://RickAstley.lnk.to/storeID
        \\nTikTok: https://RickAstley.lnk.to/TikTokID\\n\\nListen to Rick Astley:\\nSpotify:
        https://RickAstley.lnk.to/SpotifyID \\nApple Music: https://RickAstley.lnk.to/AppleMusicID
        \\nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \\nDeezer: https://RickAstley.lnk.to/DeezerID
        \\n\\nLyrics:\\nWe\u2019re no strangers to love\\nYou know the rules and so
        do I\\nA full commitment\u2019s what I\u2019m thinking of\\nYou wouldn\u2019t
        get this from any other guy\\n\\nI just wanna tell you how I\u2019m feeling\\nGotta
        make you understand\\n\\nNever gonna give you up\\nNever gonna let you down\\nNever
        gonna run around and desert you\\nNever gonna make you cry\\nNever gonna say
        goodbye\\nNever gonna tell a lie and hurt you\\n\\nWe\u2019ve known each other
        for so long\\nYour heart\u2019s been aching but you\u2019re too shy to say
        it\\nInside we both know what\u2019s been going on\\nWe know the game and
        we\u2019re gonna play it\\n\\nAnd if you ask me how I\u2019m feeling\\nDon\u2019t
        tell me you\u2019re too blind to see\\n\\nNever gonna give you up\\nNever
